import React from 'react';


function ChartRow(props){
    return (
                <tr>
                    <td>{props.id}</td>
                    <td>{props.name}</td>
                    <td>{props.description}</td>
                    <td>{props.product_brand.name}</td>
                    <td>{props.product_category.name}</td>
                </tr>
            )
    }



export default ChartRow;
